create table patient
(
    id         bigserial not null
        constraint patient_pkey
            primary key,
    first_name varchar(50),
    last_name  varchar(50),
    email      varchar(50),
    gender     varchar(50),
    password   varchar(50),
    birt_date  date,
    cookie     varchar(50)
);

alter table patient
    owner to postgres;

